INSERT INTO `comments` VALUES (1,'Le falto detallar más información',2,24,'0000-00-00 00:00:00'),(3,'Gracias lo tomare en cuenta',2,24,'0000-00-00 00:00:00'),(4,'Excelente. Colocó todos los detalles correctamente!',2,59,'0000-00-00 00:00:00'),(5,'Excelente. Colocó todos los detalles correctamente!',2,59,'0000-00-00 00:00:00'),(6,'Muy buen',2,59,'0000-00-00 00:00:00'),(12,'Consider que le falto colocar algunos parametros mas claros. Me parece que ha hecho un buen trabajo. Lo felicito y espero que siga haciendo asi sus trabajos. En este momento estare revisando los demas formatos. Yo le estaré informando si tengo alguna duda o comentario de esos formatos en cada uno de ellos. Nuevamente, mi mas sinceras felicitaciones y continue cosechando logros.',4,53,'2016-10-17 01:44:26'),(13,'Y falto poner mi opinion',3,53,'2016-10-17 01:44:26'),(14,'Tambien la mia',4,53,'2016-10-17 00:42:35'),(15,'Tambien la mia 2',4,53,'2016-10-17 00:48:05'),(16,'Tambien la mia 3',4,53,'2016-10-17 00:50:16'),(17,'Tambien la mia 4',4,53,'2016-10-17 00:54:22'),(18,'Tambien la mia 5',4,53,'2016-10-17 01:20:35'),(19,'Tambien la mia 6',4,53,'2016-10-17 01:35:07'),(20,'Hola Mario, tengo duda con respecto al abordaje de este caso. ¿Será necesario tener citas de manera conjunta con la madre?',7,69,'2016-10-21 22:27:45'),(21,'Creo que sí sería pertinente invitar a la madre, y más adelante realizar citas conjuntas.',9,69,'2016-10-21 23:18:57'),(22,'¿No sé si sería pertinente subir los objetivos establecidos en la sesión?',7,75,'2016-10-22 17:33:26'),(23,'Ver',2,53,'2016-10-22 18:50:39'),(24,'Hola Administrador, tengo duda con respecto al abordaje de este caso. ¿Será necesario tener citas de manera conjunta con la madre?',3,7,'2016-10-25 06:05:18'),(25,'Creo que sí sería pertinente invitar a la madre, y más adelante realizar citas conjuntas.',2,7,'2016-10-25 06:06:38'),(26,'Muchas gracias, tomaré eso en cuenta.',7,69,'2016-11-22 21:01:43');
