INSERT INTO `recomendation` VALUES (1,'Al darle las instrucciones pedirle que las vuelva a repetir para asegurarse que las haya comprendido y que se le facilite realizar lo que se le pidió.',4),(2,'Alterne el trabajo de pupitre con otras actividades que le permitan levantarse y moverse un poco. Como por ejemplo, hacerlo repartir las guías a los compañeros, borrar el pizarrón, etc.',5),(3,'Reforzar las auto-instrucciones que consisten en que el niño o la niña pueda estar ante un problema y poder darse instrucciones a ella misma de qué pasos debe realizar para poder resolver el problema que se encuentra frente a ella.',4),(4,'Asignarle actividades de su agrado como dibujar o pintar cuando termine antes que los demás alguna actividad en clase. También se le podría motivar al pedirle ayuda a que pueda apoyar a otro compañero que está teniendo dificultad para realizar la actividad.',4),(5,'Utilizar el juego de “Simón dice…” que puede fomentar la concentración y el seguimiento de instrucciones. Un jugador que asume el papel de “Simón” tiene que intentar eliminar a todos los jugadores lo antes posible. El ganador del juego es el que consiga seguir todas las instrucciones correctamente.',4),(6,'Técnica del semáforo: esta consiste en que cuando no podemos controlar una emoción (sentimos mucha rabia, queremos agredir a alguien, nos ponemos muy nerviosos) tenemos que pararnos como cuando un carro está con la luz roja del semáforo. Después de parar, es el momento de pensar y darse cuenta de lo que se está sintiendo y por qué (luz amarilla). Y si uno se da tiempo de pensar pueden surgir alternativas o soluciones al conflicto o problema. Es la hora de elegir la mejor solución (luz verde). Después de haber aprendido la técnica, van a dibujar una situación en la que crean que han perdido el control, y al lado deben de representar cómo estaba su semáforo (verde, amarillo o rojo).',5),(7,'Escritura:\r\nRealizar junto al niño ejercicios de planas o que involucren escribir, utilizando letra de molde, ya que la letra de carta implica mayor reto para un niño en edad escolar.',0),(8,'Lectura:\r\nProcurar que el niño lea en voz alta con los padres para aprender la conversión grafema-fonema. A partir de esta lectura,  los padres pueden corregir al niño; con la práctica este proceso se vuelve automático. La lecutra debe ser de total interés para el niño.',0),(9,'Fomentar el conocimiento de las letras por medio de planas y carteles en los que pueda tener un reforzamiento visual de las mismas en casa. Este tipo de refuerzos podrían aplicarse también al aprendizaje de signos de puntuación.',0),(12,'Respetar su orden y su ritual, es decir, si prefiere guardar los juguetes de una determinada manera, hacerlo igual. Así se conseguirá empatizar y poder hacer tareas juntos',6),(13,'Haz láminas con dibujos de elementos básicos para comer, bañarse, vestirse incluso de alimentos. Pégalas en un lugar donde él pueda verlas para que señale lo que desea. Puedes preguntarle, ¿qué es? y denomina los objetos tú misma.',6),(14,'Se pueden recortar algunas letras de cartón y colocarlas dentro de un calcetín grande. A la misma vez, poner delante del niño o niña una cartulina con las letras escondidas. El juego consistirá en que encuentre, dentro del calcetín, las letras que están en la cartulina, para hacer que coincidan. Cada vez que encuentre una letra puede repetirla y motivarla(o) a que repita el sonido.',6),(15,'Facilitar la autonomía en el aprendizaje: planificando horarios, encontrando los mejores métodos de estudio, de acuerdo a las capacidades del niño o niña; y la autocorrección de actividades y tareas.',7),(16,'Fomentar la cooperación entre compañeros realizando trabajos en grupos y en parejas. Poner al niño o niña con altas capacidades a trabajar con un niño que se le dificulte el tema o materia. De esta manera trabajará sus habilidades sociales y podrá poner en práctica lo que se le facilita ayudando a otros.',7),(17,'Motivarlo a buscar diferentes soluciones a un mismo problema, así se fomentará el pensamiento divergente e independiente.',7),(18,'Matemática:\r\nPara manejar la aritmética, el niño debe entender la cantidad que cada número representa y el concepto que involucra al resolver un problema. Para ello se pueden realizar recetas de cocina y que pueda identificar la cantidad de cada ingrediente en la receta. Así mismo se pueden trabajar operaciones matemáticas (Ej. si para 1 pastel se necesitan 4 huevos, para 5 pasteles, cuántos huevos necesitaríamos?).',0),(19,'Para procedimientos matemáticos se le puede asignar un color a cada signo (p. ej. (+) de color verde (-) de color rojo (x) de color azul (:) de color naranja). Esto le permitirá tener otro estímulo del cual apoyarse para poder realizar las operaciones.',0);
/*!40000 ALTER TABLE `recomendation` ENABLE KEYS */;
UNLOCK TABLES;

