INSERT INTO `test` VALUES (0,'Trastorno de aprendizaje (escritura, lectura y matematica)','Son trastornos con base neurobiológica, a menudo con un componente genético que condiciona al niño, a pesar que este tenga una inteligencia normal. El niño puede que no consiga avanzar en uno o más aprendizajes de forma adecuada.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(1,'Acoso Laboral','Se define acoso laboral a una situación en la que una persona ejerce una presión o violencia psicológica extrema por un período prolongado con el fin de destruir la reputación o comunicación de esta persona con otros colaboradores y forzando a la persona a abandonar su lugar de trabajo. Es muy importante detectarla a tiempo ya que puede ser muy dañino para la salud física, emocional y mental de uno o varios colaboradores',3,'A continuación se le presentan una serie de enunciados a las cuales usted deberá responder si se encuentra en desacuerdo, indiferente o en acuerdo'),(2,'Clima Laboral','El clima laboral de una organización son las apreciaciones que los colaboradores tienen acerca de las relaciones interpersonales, relación con superiores, entre otras que tienen un efecto directo con el desempeño de un colaborador al realizer sus responsabilidades dentro de la organización. A través de esta escala se desea determinar las áreas de mejora para incrementar su bienestar y satisfacción',3,'A continuación se le presentan una serie de enunciados a las cuales usted deberá responder si se encuentra en desacuerdo, indiferente o en acuerdo'),(3,'Desgaste Laboral','El desgaste laboral es un síndrome que se caracteriza por cansancio extremo, cinismo y falta de realización personal. Es un estado de cansancio en el que una persona es cínica acerca del valor de su trabajo u ocupación.  Es muy importante detectar este síndrome para poder ayudar a los colaboradores a tiempo y que mejoren su desempeño dentro de su puesto',3,'A continuación se le presentan una serie de enunciados a las cuales usted deberá responder si se encuentra en desacuerdo, indiferente o en acuerdo'),(4,'Trastorno por deficit de atencion','El Trastorno por Déficit de Atención o TDA, involucra falta de atención y concentración. Lo que se manifiesta en niños o adolescentes que se les dificultan completar tareas, se distraen con facilidad, cometen errores imprudentes y evitan actividades que requieren de trabajo mental continuo y de mucha concentración. Esto finalmente llega a influir en su funcionamiento y rendimiento académico.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(5,'Trastorno por deficit de atencion con hiperactividad','El perfil hiperactivo-impulsivo se toma como parte del Trastorno por Déficit de Atención con hiperactividad. En este caso el niño o adolescente tiende a ser inquieto cuando debe permanecer sentado. Continuamente está hablando, teniendo grandes dificultades en permanecer callado. En comparación, con la población del subtipo con déficit de atención, puede presentar más agresividad. Del mismo modo suelen tener mayores dificultades en establecer relaciones sociales debido a su carácter impulsivo. Llegando a afectar finalmente a su funcionamiento y adaptación al medio ambiente.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(6,'Trastorno del espectro autista','Los trastornos del espectro autista (TEA) son una falla en la función neurológica con base genética, los cuales se manifiestan en etapas tempranas a través de una serie de trastornos en la interacción social, comunicación y falta de flexibilidad en el comportamiento y razonamientos.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(7,'Altas capacidades','Los niños, adolescentes o jóvenes con altas capacidades son aquellos que muestran evidencia de un rendimiento superior en las áreas: intelectual, creativo, artístico, liderazgo, o en campos académicos específicos. Además poseen o son capaces de desarrollar estos rasgos y aplicarlos a cualquier área para un valioso desempeño.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.');
/*!40000 ALTER TABLE `test` ENABLE KEYS */;
UNLOCK TABLES;

