INSERT INTO `test_questions` VALUES (4,'He sido ignorado o excluido en el trabajo',1),(5,'He recibido respuestas hostiles a mis comentarios y preguntas',1),(6,'Mis comentarios y preguntas han sido ignoradas',1),(7,'He sido controlado y/o vigilado en extremo',1),(8,'No me pasan las llamadas o dicen que no estoy',1),(9,'Me han restringido recursos necesarios para realizar mi trabajo',1),(10,'Me han obligado a realizar trabajos absurdos o inutiles',1),(11,'Me recuerdan constantemente cualquier error que cometo',1),(12,'Se me asignan tareas muy por debajo o muy por encima de mis competencias',1),(13,'He recibido criticas continuadas e injustificadas sobre mi trabajo',1),(14,'He sido victima de comentarios malintencionados de camaradas o superiores',1),(15,'He sido objeto de insultos u ofensas sobre mi persona, actitudes o mi vida privada',1),(16,'He sido viictima de burlas y bromas pesadas, sobre mi fisico, forma de ser, etc.',1),(17,'En la organizacion donde trabajo, el trato a los trabajadores es correcto y respetuoso',1),(18,'Mis jefes cuando mandan y dan ordenes suelen hacerlo de forma adecuada',1),(19,'Hay un buen entendimiento entre jefes y trabajadores',1),(20,'El desarrollo profesional (promocion), se hace de forma justa y razonable',1),(21,'En la organizacion donde trabajo la toma de decisiones es democratica',1),(22,'En la empresa en que trabajo, hay una buena informacion sobre el acoso psicologico',1),(23,'Tenemos información sobre los medios y procedimientos establecidos en mi organización en el caso de que algún trabajador sea objeto de acoso psicol',1),(24,'En mi organización hay procedimientos para intervenir en caso de acoso psicológico',1),(25,'Sufro enfermedades que atribuyo al acoso psicológico en el trabajo',1),(26,'Visito al médico debido al acoso psicológico en el trabajo ',1),(27,'Tomo la mayor parte de las decisiones para que influyan en la forma en que desempeño mi trabajo.',2),(28,'Yo decido el metodo en que ejecutaré mi trabajo. ',2),(29,'Yo propongo mis propias actividades de trabajo. ',2),(30,'Determino los estándares de ejecución de mi trabajo. ',2),(31,'Organizo mi trabajo como mejor me parece. ',2),(32,'Las personas que trabajan en mi empresa se ayudan los unos a los otros. ',2),(33,'Las personas que trabajan en mi empresa se llevan bien entre sí. ',2),(34,'Las personas que trabajan en mi empresa tienen un interés personal el uno por el otro. ',2),(35,'Existe espíritu de\"trabajo en equip\" entre las personas que trabajan en mi empresa. ',2),(36,'Siento que tengo muchas cosas en común con la gente que trabaja en mi unidad. ',2),(37,'Puedo confiar en que mi jefe no divulgue las cosas que le cuento en forma confidencial.',2),(38,'Mi jefe es una persona con principios definidos. ',2),(39,'Mi jefe es una persona con quien se puede hablar abiertamente. ',2),(40,'Mi jefe cumple con los compromisos que adquiere conmigo. ',2),(41,'No es probable que mi jefe me de un mal consejo. ',2),(42,'Tengo mucho trabajo y poco tiempo para realizarlo. ',2),(43,'Mi empresa es un lugar relajado para trabajar. ',2),(44,'En casa, a veces temo oír sonar el teléfono porque pudiera tratarse de alguien que llama sobre un problema en el trabajo',2),(45,'Me siento como si nunca tuviese un día libre. ',2),(46,'Muchas de los trabajadores de mi empresa en mi nivel, sufren de un alto estrés, debido a la exigencia. ',2),(47,'Puedo contar con la ayuda de mi jefe cuando la necesito.',2),(48,'A mi jefe la interesa que me desarrolle profesionalmente. ',2),(49,'Mi jefe me respalda al 100%. ',2),(50,'Es fácil hablar con mi jefe sobre problemas relacionados con el trabajo. ',2),(51,'Mi jefe me respalda y me deja que yo aprenda de mis propios errores.',2),(52,'Puedo contar con una felicitación cuando realizo bien mi trabajo. ',2),(53,'La única vez que se habla sobre mi rendimiento es cuando he cometido un error.',2),(54,'Mi jefe conoce mis puntos fuertes y me los hace notar.',2),(55,'Mi jefe es rápido para reconocer una buena ejecución 